import a from './1.png';
import b from './2.png';
import c from './3.png';
import d from './4.png';
import e from './5.png';
import f from './6.png';


const Tv = [
    {
    id: 1,
    image: a,
    name: 'The Witcher',
    year: '2014',
    genre: 'Tv Series'
    },{
    id: 2,
    image: b,
    name: 'You',
    year: '2014',
    genre: 'Tv Series'
    },{
    id: 3,
    image: c,
    name: 'Persona 3',
    year: '2010',
    genre: 'Tv Series'
    },{
    id: 4,
    image: d,
    name: 'Catlevania',
    year: '2018',
    genre: 'Tv Series'
    },{
    id: 5,
    image: e,
    name: 'Game of Throne',
    year: '2019',
    genre: 'Tv Series'
    },{
    id: 6,
    image: f,
    name: 'OA Part II',
    year: '2017',
    genre: 'Tv Series'
    }
];


export default Tv;
